import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";

// <-- views -->
import HomePage from "./views/homepage/Homepage";
import Hats from "../views/shop/hats";

function App() {
	return (
		<>
			<Router>
				<Switch>
					<Route exact path="/" component={HomePage} />
				</Switch>
			</Router>
		</>
	);
}

export default App;
